import BaseType from './base-type';
export default abstract class BytesType<TClass> extends BaseType<TClass, Uint8Array, string | Uint8Array> {
    get value(): Uint8Array;
    private internalValue;
    toHexString(): string;
    protected validate(): void;
    protected setValue(value: string | Uint8Array): void;
    /**
     * Internal equals
     * @param other The other uint8array
     */
    protected internalEquals(other: Uint8Array): boolean;
    /**
     * Get required byte length
     */
    protected abstract getRequiredByteLength(): number;
}
